--
-- Name: crear_empresa(character varying, character varying, character varying, integer, integer); Type: FUNCTION; Schema: cfg; Owner: umenube
--

CREATE FUNCTION cfg.crear_empresa(nombre character varying, telefono character varying, direccion character varying, idempresa_copia integer, idempresa integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
  empresa RECORD;
  usuario_adm RECORD;
BEGIN
  
WITH t AS (
	INSERT INTO 
      cfg.t_empresas
    (
      f_idrecord,
      f_nombre,
      f_telefono,
      f_direccion
    )
    VALUES (
      idempresa,
      nombre,
      telefono,
      direccion
    ) RETURNING *
)

SELECT INTO empresa * FROM t;

INSERT INTO 
  public.t_ncf
(
  f_descripcion,
  f_tipo,
  f_valida_fecha_vigencia,
  f_valida_rnc,
  f_idempresa
)
 
  SELECT 
    n.f_descripcion,
    n.f_tipo,
    n.f_valida_fecha_vigencia,
    n.f_valida_rnc,
    empresa.f_idrecord
  FROM 
 	 public.t_ncf n
  WHERE 
  	n.f_idempresa = idempresa_copia;

INSERT INTO 
  public.t_tiposdocumentos
(
  f_tipodoc,
  f_descripcion_tipo,
  f_idordenador,
  f_idempresa
)
 
  SELECT
  	d.f_tipodoc,
    d.f_descripcion_tipo,
    d.f_idordenador,
  	empresa.f_idrecord
  FROM 
  	public.t_tiposdocumentos d 
  WHERE d.f_idempresa = idempresa_copia;
  
  
--crear usuario administrador

WITH u AS (
	INSERT INTO 
  public.t_usuarios
  (
    f_idempresa,
    f_username,
    f_password,
    f_nombre,
    f_cambio_precio,
    f_abrir_caja,
    f_descuento,
    f_factura_credito,
    f_cuadre,
    f_estado_caja,
    f_factura_oficial,
    f_anular_linea,
    f_recibo,
    f_porciento_ley,
    f_taxfree,
    f_anular_factura,
    f_tipo_usuario_punto_venta
  )
  VALUES (
    empresa.f_idrecord,
    'admin',
    MD5('@admin'),
    'admin',
    true,
    TRUE,
    true,
    TRUE,
    TRUE,
    TRUE,
    TRUE,
    TRUE,
    TRUE,
    TRUE,
    TRUE,
    TRUE,
    4
  ) returning *
)

SELECT INTO usuario_adm * FROM u;

INSERT INTO cfg.t_permisos_usuario (f_idopcion, f_idusuario)
SELECT m.f_id, usuario_adm.f_idrecord FROM cfg.t_opciones_menu m;

INSERT INTO 
  public.t_areas
(
  f_idempresa,
  f_nombre_area,
  f_tiempo_camarero
)
VALUES (
  empresa.f_idrecord,
  'RESTAURANT',
  0
);

INSERT INTO 
  public.t_conceptos_inventario
(
  f_idempresa,
  f_descripcion,
  f_entrada,
  f_hechopor
)
VALUES (
  empresa.f_idrecord,
  'Inicio de inventario',
  true,
  usuario_adm.f_idrecord
),
(
  empresa.f_idrecord,
  'Ajuste de inventario',
  false,
  usuario_adm.f_idrecord
),
(
  empresa.f_idrecord,
  'Ajuste de inventario',
  TRUE,
  usuario_adm.f_idrecord
);


RETURN 1;

END;
$$;


