--
-- Name: ft_cuadre_cajero_tr(); Type: FUNCTION; Schema: public; Owner: umenube
--

CREATE FUNCTION public.ft_cuadre_cajero_tr() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN

  INSERT INTO 
  public.t_cuadre_diario
(
  f_cajero,
  f_factcon,
  f_factcred,
  f_montocred,
  f_montocon,
  f_montotarjeta,
  f_montoitbis,
  f_fecha,
  f_posteado,
  f_montocheque,
  f_monto_caja,
  f_monto_cierre,
  f_monto_devolucion,
  f_recibo,
  f_devolucion_credito,
  f_idempresa
) 
SELECT 
       f.f_hecho_por,
       get_cantidad_facturas(f.f_hecho_por, f.f_idempresa, 6) as f_factura_contado,
       get_cantidad_facturas(f.f_hecho_por, f.f_idempresa, 4) as f_factura_credito,
       get_monto_por_tipo(f.f_idempresa,f.f_hecho_por,4) as f_monto_credito,
       get_monto_por_tipo(f.f_idempresa,f.f_hecho_por,6) as f_monto_contado,
       get_monto_por_tarjeta(f.f_hecho_por,f.f_idempresa) as f_monto_tarjeta,
       COALESCE(sum(f.f_itebis), 0) as f_itebis,
       now() as f_fecha,
       false as f_posteado,
       0::NUMERIC f_monto_cheque,
       get_cuadre_hoy(f.f_hecho_por,f.f_idempresa) as f_monto_caja,
       get_cuadre_hoy_cierre(f.f_hecho_por,f.f_idempresa) as f_monto_cierre,
       0::NUMERIC f_monto_devolucion,
       0::NUMERIC f_recibo,
       0::NUMERIC f_devolucion_credito,
       f.f_idempresa
from t_facturas as f
	   where f.f_modulo = 2 and
       f.f_idempresa = new.f_idempresa and
       f.f_hecho_por =new.f_idcajero and
       f.f_fecha_registro_factura::date = now() ::date
GROUP by f.f_hecho_por,
         f_factura_contado,
         f_factura_credito,
         f_monto_credito,
         f_monto_contado,
         f_monto_tarjeta,
         f_monto_caja,
         f_monto_cierre,
         f.f_idempresa;
         
 RETURN new;

END;
$$;


