-- Name: ft_detalle_factura_tr(); Type: FUNCTION; Schema: public; Owner: umenube
--

CREATE FUNCTION public.ft_detalle_factura_tr() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
  reg record;
BEGIN
 
SELECT into reg * from t_productos as p WHERE p.f_idempresa = NEW.f_idempresa and p.f_idrecord = new.f_idproducto;

  IF new.f_movil = false or NEW.f_movil is null THEN
    IF reg.f_controlinventario = true THEN
       UPDATE t_productos   set f_existencia = f_existencia - new.f_cantidad WHERE f_idempresa = NEW.f_idempresa and f_idrecord = new.f_idproducto;
    END IF;
  END IF;
RETURN NEW;
END;
$$;


