--
-- Name: ft_factura_detalle_temporal_tr(); Type: FUNCTION; Schema: public; Owner: umenube
--

CREATE FUNCTION public.ft_factura_detalle_temporal_tr() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
  id INTEGER;
  control_inventario BOOLEAN; 
  kit BOOLEAN; 

BEGIN

SELECT INTO control_inventario ,kit p.f_controlinventario,p.f_kit  FROM t_productos AS p WHERE p.f_idrecord = NEW.f_idproducto AND p.f_idempresa = NEW .f_idempresa;


IF control_inventario = TRUE and kit = FALSE THEN
  
  UPDATE t_productos
     SET f_existencia = f_existencia - NEW . f_cantidad
     WHERE f_idrecord = NEW . f_idproducto AND
           f_idempresa = NEW . f_idempresa;
            
END IF;
RETURN NEW ;
END;
$$;


