--
-- Name: ft_factura_detalle_temporal_tr2(); Type: FUNCTION; Schema: public; Owner: umenube
--

CREATE FUNCTION public.ft_factura_detalle_temporal_tr2() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
  cantidad NUMERIC;
  control_inventario BOOLEAN;
BEGIN

cantidad := NEW.f_cantidad - OLD.f_cantidad ;

SELECT INTO control_inventario p.f_controlinventario  FROM  t_productos AS p WHERE p.f_idrecord = NEW.f_idproducto AND p.f_idempresa = NEW .f_idempresa;
IF cantidad < 0 THEN



--IF NEW.f_tableta = FALSE THEN
  RAISE NOTICE 'Cantidad --> %', 'Menor';
      IF control_inventario = TRUE THEN
        
        UPDATE t_productos
           SET f_existencia = f_existencia + (cantidad*(-1))
           WHERE f_idrecord = NEW . f_idproducto AND
                 f_idempresa = NEW . f_idempresa ;
      END IF;

ELSE

    IF control_inventario = TRUE THEN
      
      UPDATE t_productos
         SET f_existencia = f_existencia - cantidad
         WHERE f_idrecord = NEW . f_idproducto AND
               f_idempresa = NEW . f_idempresa;
    END IF;
    

END IF;

RETURN NEW;

END;
$$;


