--
-- Name: generar_cuadre_cajero(integer, integer); Type: FUNCTION; Schema: public; Owner: umenube
--

CREATE FUNCTION public.generar_cuadre_cajero(idusuario integer, idempresa integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
  reg record;
  fecha date;
  id integer;
BEGIN

SELECT into fecha emp.f_fecha_inicio_operaciones::date   from cfg.t_empresas as emp WHERE emp.f_idrecord = idempresa;

--BUSCAMOS TODOS LOS REGISTROS PARA EL CIERRE DEL USUARIO
 SELECT into reg
       f.f_facturado_por,
       get_cantidad_facturas(f.f_facturado_por, f.f_idempresa, 6) as f_factura_contado,
       get_cantidad_facturas(f.f_facturado_por, f.f_idempresa, 4) as f_factura_credito,
       get_cantidad_pedidos(f.f_facturado_por,f.f_idempresa) as f_pedidos,
       get_monto_por_tipo(f.f_idempresa,f.f_facturado_por,4) as f_monto_credito,
       get_monto_por_tipo(f.f_idempresa,f.f_facturado_por,6) as f_monto_contado,
       get_monto_pedidos(f.f_facturado_por,f.f_idempresa) as f_monto_pedidos,
       get_monto_por_tarjeta(f.f_facturado_por,f.f_idempresa) as f_monto_tarjeta,
       COALESCE(sum(f.f_itebis), 0) as f_itebis,
       0::NUMERIC f_monto_cheque,
       COALESCE(sum(f.f_envio), 0) f_monto_envio,
       now() as f_fecha,     
       --get_cuadre_hoy(f.f_facturado_por,f.f_idempresa) as f_monto_caja,
       0::NUMERIC  as f_monto_caja,
       0::NUMERIC f_recibo,
       get_monto_cancelado(f.f_idempresa,f.f_facturado_por) as f_monto_cancelado,
        false as f_posteado,
       f.f_idempresa
from t_facturas as f where  f.f_idempresa = idempresa and
       f.f_facturado_por = idusuario and
       f.f_posteado = false and
       f.f_fecha_operacion::date = fecha
GROUP by f.f_facturado_por,
         f_factura_contado,
