  reg.f_itebis,
  reg.f_monto_cheque,
  reg.f_monto_envio,
  reg.f_monto_caja,
  reg.f_recibo,
  reg.f_monto_cancelado,
  false,
  idusuario
) 
RETURNING * ) SELECT into id f_idrecord from tabla;
ELSE

        
WITH tabla as (         
INSERT INTO 
  public.t_cuadre_cajero
(
  f_idempresa,
  f_fecha,
  f_fecha_generado,
  f_cajero,
