) 
RETURNING * ) SELECT into id f_idrecord from tabla;

END IF;
         
 



UPDATE t_facturas set f_posteado = TRUE WHERE f_facturado_por = idusuario AND f_idempresa = idempresa and f_posteado = false;

RETURN id;
END;
$$;


