--
-- Name: generar_cuadre_diario(integer, integer); Type: FUNCTION; Schema: public; Owner: umenube
--

CREATE FUNCTION public.generar_cuadre_diario(idusuario integer, idempresa integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
   fecha date;
   reg record;
   id integer;
BEGIN
SELECT into fecha emp.f_fecha_inicio_operaciones::date   from cfg.t_empresas as emp WHERE emp.f_idrecord = idempresa;
id:=0;
SELECT into reg
  c.f_idempresa,
  fecha as f_fecha,
  now() as f_fecha_generado, 
  sum(c.f_factcontado) as f_factcontado,
  sum(c.f_factcredito) as f_factcredito,
  sum(c.f_pedidos) as f_pedidos,
  sum(c.f_montocredito) as f_montocredito,
  sum(c.f_montocontado) as f_montocontado,
  sum(c.f_monto_pedidos) as f_monto_pedidos,
  sum(c.f_montotarjeta) as f_montotarjeta,
  sum(c.f_montoitbis) as f_montoitbis,
  sum(c.f_montocheque) as f_montocheque,
  sum(c.f_montoenvio) as f_montoenvio,
  sum(c.f_monto_caja) as f_monto_caja,
  sum(c.f_monto_recibo)as f_monto_recibo,
  sum(c.f_monto_cancelado) as f_monto_cancelado,
  idusuario as f_hecho_por
  FROM t_cuadre_cajero as c WHERE c.f_idempresa = idempresa and c.f_posteado = false and c.f_fecha = fecha
  GROUP BY f_idempresa,f_fecha,f_hecho_por;
  
    
  IF reg is not null THEN
  
  WITH tabla as (   
        INSERT INTO 
        public.t_cuadre_diario
      (
        f_idempresa,
        f_fecha,
        f_fecha_generado,
        f_factcontado,
        f_factcredito,
        f_pedidos,
        f_montocredito,
        f_montocontado,
        f_monto_pedidos,
        f_montotarjeta,
        f_montoitbis,
        f_montocheque,
        f_montoenvio,
        f_monto_caja,
        f_monto_recibo,
        f_monto_cancelado,
        f_hecho_por
      )values(
      reg.f_idempresa,
      reg.f_fecha,
      reg.f_fecha_generado, 
      reg.f_factcontado,
      reg.f_factcredito,
      reg.f_pedidos,
      reg.f_montocredito,
      reg.f_montocontado,
      reg.f_monto_pedidos,
      reg.f_montotarjeta,
      reg.f_montoitbis,
      reg.f_montocheque,
      reg.f_montoenvio,
      reg.f_monto_caja,
      reg.f_monto_recibo,
      reg.f_monto_cancelado,
      reg.f_hecho_por
      )RETURNING *
      ) SELECT into id f_idrecord from tabla;
      
      UPDATE t_cuadre_cajero  set f_posteado = true where f_idempresa = idempresa and f_posteado = false;
      UPDATE cfg.t_empresas  set f_fecha_inicio_operaciones = f_fecha_inicio_operaciones::date + 1 where f_idrecord = idempresa;
    
  END IF;
  
  


RETURN id;
END;
$$;


ALTER FUNCTION public.generar_cuadre_diario(idusuario integer, idempresa integer) OWNER TO umenube;

--
-- Name: generar_factura_empresa(integer, integer, integer, date, date, integer, text); Type: FUNCTION; Schema: public; Owner: umenube
--

CREATE FUNCTION public.generar_factura_empresa(idcliente integer, idempresa integer, idtiponcf integer, f1 date, f2 date, idechopor integer, tipodocumento text) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
  REG record;
  NCF VARCHAR(50);
  ID INTEGER;
  numero INTEGER;
  cont INteger;
  periodo varchar(40);
BEGIN
	SELECT INTO cont count(*)     
    FROM 
      public.t_facturas a
    WHERE
       a.f_modulo=1 AND
       a.f_fecha_registro_factura::date  >= f1 AND  
       a.f_fecha_registro_factura::date  <= f2 AND
       a.f_idempresa = idempresa AND
       a.f_idcompania = idcliente AND
       a.f_facturada = true AND
       a.f_enviada = false AND
       a.f_cancelada = FALSE;
       
    if cont > 0 THEN
    	--RAISE NOTICE '% ',CONT;
        SELECT into numero get_secuencia(tipodocumento,FALSE,idempresa)::INTEGER;
        --
        NCF:=get_secuencia_ncf(idtiponcf);

        --
        --Buscando los totales para salvar el encabezado de la factura
        --
        periodo:=to_char(f1,'YYYY-MM-DD') || ' al ' || to_char(f2,'YYYY-MM-DD');
        
        SELECT INTO REG
          tipodocumento,numero,idempresa,
          COALESCE(sum(f_total),0) as total,
          COALESCE(sum(f_descuento),0) as des,
          COALESCE(sum(f_itebis),0) as tax,
          count(f_idrecord) as qty,
          idechopor,NCF,periodo
        FROM 
          public.t_facturas a
        WHERE
           a.f_modulo=1 AND
           a.f_fecha_registro_factura::date  >= f1 AND  
           a.f_fecha_registro_factura::date  <= f2 AND
           a.f_idempresa = idempresa AND
           a.f_idcompania = idcliente AND
           a.f_facturada = true AND
           a.f_enviada = false AND
           a.f_cancelada = FALSE;
         --
         raise notice '% % ',reg.total,reg.tax;
         --
        INSERT INTO  public.t_factura_empresa
        (
          f_tipo,f_numero_factura,f_idempresa, f_monto_total,
          f_descuento, f_tax,f_total_ordenes,f_hecho_por,f_ncf,f_periodo,f_idcompania
        )
        VALUES 
          (reg.tipodocumento,
          reg.numero,
          reg.idempresa,
          reg.total,
          reg.des,
          reg.tax,
          reg.qty,
          reg.idechopor,
          reg.NCF,
          reg.periodo,idcliente)
        RETURNING Into id f_idrecord;
        --
        --Salvando el detalle de las facturas
        --
        INSERT INTO  public.t_facturas_empresa_detalle(f_idfactura_empresa,f_idorden)
        SELECT 
          id,a.f_idrecord
        FROM 
          public.t_facturas a
        WHERE
         a.f_modulo=1 AND
         a.f_fecha_registro_factura::date  >= f1 AND  
         a.f_fecha_registro_factura::date  <= f2 AND
         a.f_idempresa = idempresa AND
         a.f_idcompania = idcliente AND
         a.f_facturada = true AND
         a.f_enviada = false AND
         a.f_cancelada = FALSE;
         --
         -- Actualizar las facturas seleccionadas para no ser tomadas de nuevo
         --
         
         UPDATE  public.t_facturas
         SET
         	f_enviada=TRUE	  
         WHERE
           f_modulo=1 AND
           f_fecha_registro_factura::date  >= f1 AND  
           f_fecha_registro_factura::date  <= f2 AND
           f_idempresa = idempresa AND
           f_idcompania = idcliente AND
           f_facturada = true AND
           f_enviada = false AND
           f_cancelada = FALSE;
        
         RETURN id;
    ELSE
    	RETURN -1;
    end if;
  


/*

    --registro de la factura
    FOR reg IN  

    SELECT 
    COALESCE(sum(fac.f_total),0) as f_monto,
    COALESCE(sum(fac.f_descuento),0) as f_descuento,
    COALESCE(sum(fac.f_itebis),0) as f_itebis,
    (SELECT count(f.f_idrecord) 
    from t_facturas as f 
    where f.f_idempresa=idempresa and to_char(f.f_fecha_regstro_orden, 'yyyy/MM/dd') 
    BETWEEN f1 and f2 and f.f_facturada=true and f.f_cancelada=false and f.f_idcliente=idcliente ) as f_total_ordenes
    FROM public.t_facturas as fac
    where fac.f_idempresa = idempresa AND
          to_char(fac.f_fecha_regstro_orden, 'yyyy/MM/dd') BETWEEN f1 and
          f2 and fac.f_facturada=true and fac.f_cancelada=false and fac.f_idcliente=idcliente  
	LOOP
    
    INSERT INTO public.t_factura_empresa(f_tipo,f_numero_factura,f_idempresa,f_fecha,f_monto_total,f_nfc,f_descuento,f_tax, f_total_ordenes,f_hecho_por) 
    VALUES (tipodocumento,numero,idempresa,now(),reg.f_monto,idtiponcf,reg.f_descuento,reg.f_itebis,reg.f_total_ordenes,idechopor);
    END LOOP;

    select into idfactura fe.f_idrecord from t_factura_empresa as fe WHERE fe.f_numero_factura=numero LIMIT 1;

    --registro del detalle
    FOR reg1 IN  SELECT fac.f_idrecord
    FROM public.t_facturas as fac
    where fac.f_idempresa = idempresa AND
          to_char(fac.f_fecha_regstro_orden, 'yyyy/MM/dd') BETWEEN f1 and
          f2 and fac.f_facturada=true and fac.f_cancelada=false and fac.f_idcliente=idcliente LOOP
    INSERT INTO 
      public.t_detalle_facturas_empresa (f_idfactura_empresa,f_idorden)VALUES (idfactura,reg1.f_idrecord);
      
      end LOOP;
 */
      
   
     
END;
$$;


