CREATE FUNCTION public.get_cantidad_facturas(idcajero integer, empresa integer, tipo integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
  reg INTEGER;
  fecha date;
BEGIN

 SELECT into fecha  emp.f_fecha_inicio_operaciones::date   from cfg.t_empresas as emp WHERE emp.f_idrecord = empresa;
  SELECT into reg
  count(f.f_idrecord) as f_cuenta
  from t_facturas f
  where f.f_idempresa = empresa and
        f.f_facturado_por = idcajero and
        --f.f_fecha_registro_factura::date = now() ::date 
        f.f_fecha_operacion = fecha 
        and f.f_tipo_documento_factura=get_tipo_doc(tipo)
        and f.f_posteado = false ;
       -- and f.f_modulo=2;
  
  RETURN reg;
  
  end;
$$;


