--
-- Name: get_componentes_detalles_impresion_json(integer); Type: FUNCTION; Schema: public; Owner: umenube
--

CREATE FUNCTION public.get_componentes_detalles_impresion_json(iddetalle integer) RETURNS text
    LANGUAGE plpgsql
    AS $$
DECLARE
  texto text;
BEGIN
  select into texto array_to_json(array_agg(row_to_json(t)))
  from (
         SELECT 
                fdc.f_cantidad,
                p.f_descripcion,
                COALESCE(fdc.f_monto_cobrar,0) as f_monto_cobrar,
                COALESCE(fdc.f_monto_cobrar*(p.f_tax/100),0)::NUMERIC(15,2) as f_itebis_producto
                FROM  public.t_factura_detalle_componentes  as fdc
                INNER join t_productos as p on p.f_idrecord=fdc.f_idprodcuto_componente
                WHERE fdc.f_iddetalle=iddetalle and fdc.f_ingrediente=1
       ) t;

  texto:= '{"f_datos":'|| texto ||'}';
  RETURN COALESCE(encode(texto::bytea,'base64'),'[]');

END;
$$;


ALTER FUNCTION public.get_componentes_detalles_impresion_json(iddetalle integer) OWNER TO umenube;

