--

CREATE FUNCTION public.get_estatus_intervalo(idfactura integer) RETURNS integer
    LANGUAGE sql
    AS $_$
SELECT
    EXTRACT(EPOCH FROM age(now(), e.f_fecha))::integer as intervalo
                
FROM
    t_pedidos_estatus e
WHERE
    e.f_idfactura = $1 order by e.f_fecha limit 1
$_$;


