-- Name: get_estatus_orden(integer); Type: FUNCTION; Schema: public; Owner: umenube
--

CREATE FUNCTION public.get_estatus_orden(idfactura integer) RETURNS text
    LANGUAGE plpgsql
    AS $$
DECLARE
texto text;
BEGIN
--SELECT  e.f_descripcion FROM  t_estatus as e WHERE e.f_idrecord = (SELECT max(f_idestatus) FROM t_pedidos_estatus WHERE f_idfactura = 309);
SELECT into texto e.f_descripcion from t_pedidos_estatus as p 
INNER JOIN t_estatus as e on e.f_idrecord = p.f_idestatus
WHERE p.f_idfactura = idfactura ORDER BY p.f_idestatus DESC LIMIT 1;

RETURN texto;
 
END;
$$;


