--
-- Name: get_fecha_vigencia_ncf(integer, integer); Type: FUNCTION; Schema: public; Owner: umenube
--

CREATE FUNCTION public.get_fecha_vigencia_ncf(idncf integer, idempresa integer) RETURNS text
    LANGUAGE plpgsql
    AS $$
DECLARE
  reg record;
  fecha text;
BEGIN
fecha:='N/A';

SELECT into reg * from t_ncf as n where n.f_idempresa = idempresa and n.f_idrecord = idncf;

IF reg.f_valida_fecha_vigencia = true 
THEN

  SELECT into fecha  to_char(logs.f_fecha_final,'dd/MM/yyyy') from t_logs_ncf as logs WHERE logs.f_tipo_ncf = idncf and logs.f_idempresa = idempresa ;

END IF;

RETURN fecha;
 
END;
$$;


