--
-- Name: get_monto_por_tarjeta(integer, integer); Type: FUNCTION; Schema: public; Owner: umenube
--

CREATE FUNCTION public.get_monto_por_tarjeta(idcajero integer, empresa integer) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
  reg numeric;
  fecha date;
BEGIN


SELECT INTO fecha  emp.f_fecha_inicio_operaciones::date   from cfg.t_empresas as emp WHERE emp.f_idrecord = empresa;
SELECT INTO reg COALESCE(sum(t.f_monto), 0) as f_monto
from t_pagos_tarjeta t
--WHERE t.f_fecha::date = now() ::date and
WHERE t.f_fecha_operacion::date = fecha and
      t.f_idfactura IN (
                         SELECT f.f_idrecord
                         from t_facturas f
                         where 
                               --f.f_modulo = 2 and
                               f.f_facturado_por = idcajero and
                               f.f_idempresa = empresa and
                               f.f_fecha_operacion::date = fecha and f.f_posteado = false 
);

return reg;                           
END;
$$;


