--
-- Name: get_monto_por_tipo(integer, integer, integer); Type: FUNCTION; Schema: public; Owner: umenube
--

CREATE FUNCTION public.get_monto_por_tipo(empresa integer, idcajero integer, tipo integer) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE

  reg numeric;
  fecha date;
BEGIN
 SELECT into fecha  emp.f_fecha_inicio_operaciones::date   from cfg.t_empresas as emp WHERE emp.f_idrecord = empresa;

  SELECT INTO reg COALESCE(sum(f.f_total),0) as f_total
  from t_facturas f
  where f.f_facturado_por = idcajero and
        f.f_idempresa = empresa and
       -- f.f_fecha_registro_factura::date = now() ::date 
       f.f_fecha_operacion = fecha
        and f.f_tipo_documento_factura = get_tipo_doc(tipo)
        and f.f_posteado = false  ;
        --f.f_modulo = 2;

  RETURN reg;
 
  END;
$$;


ALTER FUNCTION public.get_monto_por_tipo(empresa integer, idcajero integer, tipo integer) OWNER TO umenube;

--
-- Name: get_precios_productos(integer, integer, text, text, integer, integer); Type: FUNCTION; Schema: public; Owner: umenube
--

CREATE FUNCTION public.get_precios_productos(id integer, empresa integer, hinicio text, hfin text, dia integer, area integer) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
  monto NUMERIC;
  contador INTEGER;
  reg record;
BEGIN

monto:=0;

 SELECT INTO contador count(*)
  from t_productos_precios as p
  where p.f_idempresa = empresa AND p.f_precio_activo = true and
        p.f_idarea = area and
        hinicio::NUMERIC >= p.f_hora_inicio::NUMERIC and
        hfin::NUMERIC <= p.f_hora_fin::NUMERIC and
        p.f_idproducto = id and
        p.f_dia = dia;

  IF contador > 0 THEN
  
  
    SELECT INTO monto COALESCE(p.f_precio, 0) 
    from t_productos_precios as p
    where p.f_idempresa = empresa AND        p.f_precio_activo = true and
        p.f_idarea = area and
        hinicio::NUMERIC >= p.f_hora_inicio::NUMERIC and
        hfin::NUMERIC <= p.f_hora_fin::NUMERIC and
        p.f_idproducto = id and
        p.f_dia = dia;
        
        SELECT INTO reg *
  from t_productos_precios as p
  where p.f_idempresa = empresa AND p.f_precio_activo = true and
        p.f_idarea = area and
        hinicio::NUMERIC >= p.f_hora_inicio::NUMERIC and
        hfin::NUMERIC <= p.f_hora_fin::NUMERIC and
        p.f_idproducto = id and
        p.f_dia = dia;
        
        IF reg.f_doble = TRUE THEN
        
        	monto:=monto*2;
        
        END IF;
        
        
    ELSE
    
    SELECT INTO monto COALESCE(p.f_precio, 0)
    FROM t_productos as p
    WHERE p.f_idempresa = empresa AND  p.f_idrecord = id;

  END IF;
  
  RETURN monto;

END;
$$;


ALTER FUNCTION public.get_precios_productos(id integer, empresa integer, hinicio text, hfin text, dia integer, area integer) OWNER TO umenube;

