--
-- Name: get_propiedades_productos_json(integer, integer, integer); Type: FUNCTION; Schema: public; Owner: umenube
--

CREATE FUNCTION public.get_propiedades_productos_json(empresa integer, idproducto integer, iddetalle integer) RETURNS text
    LANGUAGE plpgsql
    AS $$
DECLARE
  texto text;
BEGIN

  SELECT INTO texto array_to_json(array_agg(row_to_json(t)))::text
  FROM (
          SELECT pr.*,
          CASE COALESCE(d.f_idpropiedad,-1)
          WHEN -1 THEN FALSE ELSE TRUE END as f_agregado
          FROM t_productos_propiedades p
              INNER JOIN t_propiedades as pr on p.f_idpropiedad = pr.f_idrecord
              LEFT JOIN movil.t_detalle_propiedades_temporal  as d on d.f_idpropiedad = pr.f_idrecord and d.f_iddetalle = iddetalle
          WHERE p.f_idempresa = empresa and
               p.f_idproducto = idproducto
       ) t;

  RETURN texto;
END;
$$;


