--
-- Name: get_secuencia(character varying, boolean, integer); Type: FUNCTION; Schema: public; Owner: umenube
--

CREATE FUNCTION public.get_secuencia(character varying, concat boolean, empresa integer) RETURNS character varying
    LANGUAGE plpgsql
    AS $_$
DECLARE

       tipodoc ALIAS FOR $1;

       secuencia int4;

       registro record;

BEGIN

   /*-----------------------------------------------------------------------------------------*/

    secuencia :=1;



    select into registro * from t_secuencias

    where f_tipo_documento = tipodoc and  f_empresa = empresa for update;



   IF NOT FOUND  THEN

       INSERT INTO t_secuencias (f_tipo_documento, f_secuencia,f_empresa)

       VALUES (tipodoc,secuencia,empresa);

    ELSE

        secuencia:= registro.f_secuencia+secuencia;

        UPDATE t_secuencias SET f_secuencia = secuencia

        WHERE f_tipo_documento = tipodoc and  f_empresa = empresa;

    END IF;

if concat then
    return tipodoc || to_char(secuencia,'FM0000000');
else
  return secuencia::varchar; --,'FM0000000');  
 end if; 
   

END;
$_$;


ALTER FUNCTION public.get_secuencia(character varying, concat boolean, empresa integer) OWNER TO umenube;

