CREATE FUNCTION public.set_wholenum_cliente_facturado() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
  IF new.f_facturada = true THEN
    UPDATE t_facturas set NEW.f_wholenum_cliente = NEW.f_wholenum_cliente ||NEW.f_idcliente::text WHERE f_idempresa = new.f_idempresa and f_idrecord = new.f_idrecord ;
    
  END IF;
  RETURN NEW;
END;
$$;


