-- Name: v_opciones_menu; Type: VIEW; Schema: cfg; Owner: umenube
--

CREATE VIEW cfg.v_opciones_menu AS
 SELECT a.f_id,
    b.f_idempresa,
    a.f_descripcion,
    a.f_padre,
    a.f_url_icono,
    a.f_orden,
    a.f_comando,
    a.f_ididioma
   FROM cfg.t_opciones_menu a,
    cfg.t_opciones_menu_empresa b
