--
-- Name: v_clientes; Type: VIEW; Schema: public; Owner: umenube
--

CREATE VIEW public.v_clientes AS
 SELECT t_usuarios_movil.f_idrecord,
    0 AS f_idempresa,
    t_usuarios_movil.f_nombre,
    t_usuarios_movil.f_telefono,
    t_usuarios_movil.f_direccion,
    COALESCE(t_usuarios_movil.f_email, ''::character varying) AS f_email,
    ('CM'::text || (t_usuarios_movil.f_idrecord)::text) AS f_wholenum
   FROM movil.t_usuarios_movil
UNION ALL
 SELECT t_clientes.f_idrecord,
    t_clientes.f_idempresa,
    (((COALESCE(t_clientes.f_nombre, ''::character varying))::text || ' '::text) || (COALESCE(t_clientes.f_apellido, ''::character varying))::text) AS f_nombre,
    t_clientes.f_telefono,
    t_clientes.f_direccion,
    COALESCE(t_clientes.f_email_principal, ''::character varying) AS f_email,
    ('C'::text || (t_clientes.f_idrecord)::text) AS f_wholenum
   FROM public.t_clientes;


